import { Card, Avatar } from "antd";

const UserProfile = () => {
  return (
    <Card
      actions={[
        <div key="twit">
          짹짹
          <br />0
        </div>,
        <div key="folloings">팔로잉</div>,
        <div key="followers">팔로워</div>,
      ]}
    >
      <Card.Meta title="Jun" avatar={<Avatar>JUN</Avatar>}></Card.Meta>
    </Card>
  );
};

export default UserProfile;
